import React from 'react';
import './style.css';
/* import BgVideo from "../src/components/BgVideo.jsx"; */
import video from '../src/assets/white_bg.mp4';
import Intro from './intro';
import Presentation from './presentation';
import Competence from './competence';

function App() {
  return (
    <div className="App">
      <div className="bg">
        <video autoPlay muted loop id="background-video">
          <source src={video} type="video/mp4" />
          Your browser does not support the video tag.
        </video>
      </div>
      <header className="App-header">

        {/* citation */}
      </header>
        <main>
        <Intro/>
        {/* Section Présentation */}
        <Presentation/>
        {/* Section Liste */}

        <Competence/>



        <section id="experiences">
          <h2>Expérience professionnel</h2>
          <h1>Parcours :</h1>
          <ul>
            {/* Parcours scolaire, Parcours professionnel, Etc… */}
            <li>2021-2023 : Baccalauréat Scientifique</li>
            <li>2023-2028 : Epitech Lyon</li>
          </ul>
        </section>

        <section id="contact">
          <h2>Contact :</h2>
          <ul>
            <li>LinkedIn</li>
            <li>GitHub</li>
            <li>Mail</li>
          </ul>
        </section>
      </main>

      <script src="app.js"></script> {/* Inclusion du fichier JavaScript */}
    </div>
  );
}

export default App;
